import React from 'react';
import './App.css'

function App() {
	return (
		<div className="App">
			<header className="header">
				<div className="container">
					<div className="header__logo"></div>
					<nav className="header__nav nav">
						<ul className="nav__list">
							li.nav__item
						</ul>
					</nav>
				</div>
			</header>
			<footer className="footer"></footer>
		</div>
	);
}

export default App;
